        console.log(name," ",temp2);
        setName(temp1);
        console.log(name);
        temp1=temp2;
    }

    return(
        <div className="card">
            <h1 className="h1">I AM THE SENSATIONAL</h1>
            <h1>{name}</h1>
            <button className="btn" onClick={magic}>see magic</button>
        </div>
    )
}

